import React, { useState, useEffect } from "react";
import { NavLink } from "react-router-dom";
import { FaUserCircle, FaSignOutAlt } from "react-icons/fa";
import "../styles/styles.css";

const Navigation = () => {
  const [isDropdownOpen, setDropdownOpen] = useState(false);
  const [userFirstName, setUserFirstName] = useState(null);

  useEffect(() => {
    const token = localStorage.getItem("access_token");
    if (token) {
      try {
        const decodedToken = JSON.parse(localStorage.getItem("user_data"));
        setUserFirstName(decodedToken ? decodedToken.fname : null);
      } catch (e) {
        console.error("Error decoding token", e);
      }
    }
  }, []);

  const toggleDropdown = () => setDropdownOpen(!isDropdownOpen);
  const closeDropdown = () => setDropdownOpen(false);

  return (
    <div className="navigation">
      {userFirstName ? (
        <div className="nav-container">
          <div className="search">
            <input type="text" placeholder="Search..." />
          </div>
          <div className="nav-links">
            <NavLink exact to="/" activeClassName="active-link">
              Home
            </NavLink>
            <NavLink to="/trades" activeClassName="active-link">
              Trades
            </NavLink>
            <NavLink to="/analysis" activeClassName="active-link">
              Analysis
            </NavLink>
            <div className="user-dropdown" onMouseLeave={closeDropdown}>
              <button className="user-btn" onClick={toggleDropdown}>
                <FaUserCircle className="user-icon" />
                <span>{userFirstName}</span>
              </button>
              {isDropdownOpen && (
                <div className="dropdown-menu">
                  <NavLink to="/accounts" activeClassName="active-link">
                    Profile
                  </NavLink>
                  <NavLink to="/settings" activeClassName="active-link">
                    Settings
                  </NavLink>
                  <button
                    className="logout-btn"
                    title="Logout"
                    onClick={() => {
                      localStorage.removeItem("access_token");
                      localStorage.removeItem("user_data");
                      window.location.href = "/start";
                    }}
                  >
                    <FaSignOutAlt className="logout-icon" />
                  </button>
                </div>
              )}
            </div>
          </div>
        </div>
      ) : (
        <div className="nav-links">
          <NavLink to="/start" activeClassName="active-link">
            Login
          </NavLink>
        </div>
      )}
    </div>
  );
};

export default Navigation;

